import { APIurls } from "../contants";
import { apiServices } from "./ApiServices";

export const APiRequest = {
  signup: async (data) => await apiServices.post(APIurls.signup, data),
  loginin: async (data) => await apiServices.post(APIurls.login, data),

   getTodo: () => axios.get("http://localhost:5000/api/todos"),
  getSingleTodo: (id) => axios.get(`http://localhost:5000/api/todos/${id}`),
  addTodo: (data) => axios.post("http://localhost:5000/api/todos", data),
  updateTodo: (id, data) => axios.put(`http://localhost:5000/api/todos/${id}`, data),
  deleteTodo: (id) => axios.delete(`http://localhost:5000/api/todos/${id}`),

};
